import React from "react";


const Service = () =>{
    return (
        <>
        <h1>WELCOME SERVICE PAGE</h1>
        <div className="container-fluid">
            <div className="row">
                <div className="col-10 col-lg-6"></div>
            </div>
        </div>
        </>
    )
}

export default Service;
